import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import React from 'react';

import Post from './post/PagePost';
import Read from './post/PageLoad';
import Category from './post/PageCategory';


function App() { 
  return (
    <div className="App">
      <Routes> 
        <Route path="/" element={<Home/>}/>
        <Route path="/blog" element={<Post/>}/> 
        <Route path="/blog/:folderName/:fileName" element={<Read/>}/>
        <Route path="/blog/:categoryName" component={Post} />
      </Routes> 
    </div> 
  ); 
}


function Home() {

  return (
    <div>
      <div id="Box2" style={{ width: '20%' }}>
          <Category />
        </div>
        <div id="root" style={{ width: '80%' }}>
          <Switch>
            <Route path="/blog/:categoryName" component={Post} />
          </Switch>
        </div>
    </div>
    
  );
}

export default App;
